import React from 'react';
import './CarSelection.css'; 

const CarSelection = () => {
 
  const cars = ['car1.png', 'car2.png', 'car3.png']; 

  return (
    <div className="car-selection">
      {cars.map((car, index) => (
        <img key={index} src={car} alt={`Car ${index}`} className="car-thumbnail" />
      ))}
    </div>
  );
}

export default CarSelection;
